var font = '';
var font1 = '';
var font2 = '';
var callAddFont = function () {
    this.addFileToVFS('Montserrat-Regular-normal.ttf', font);
    this.addFont('Montserrat-Regular-normal.ttf', 'Montserrat-Regular', 'normal');
    this.addFileToVFS('Montserrat-Bold-bold.ttf', font1);
    this.addFont('Montserrat-Bold-bold.ttf', 'Montserrat-Bold', 'bold');
    this.addFileToVFS('PlayfairDisplay-Medium-normal.ttf', font2);
    this.addFont('PlayfairDisplay-Medium-normal.ttf', 'PlayfairDisplay-Medium', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])


const addFooter = (doc) => {
    doc.setFont('normal');
    doc.setFontSize(8);
    doc.addImage(footerImg, 0, 272, 218, 30); //25
}
const addFooterOld = (doc) => {
    doc.setFont('normal');
    doc.setFontSize(8);
    doc.addImage(footerImgOld, 0, 272, 218, 30); //25
}

